/*Table structure for table `producto` */

DROP TABLE IF EXISTS `producto`;

CREATE TABLE `producto` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tipo_producto_id` int(11) DEFAULT NULL,
  `linea_negocio_id` int(11) DEFAULT NULL,
  `nombre` varchar(250) NOT NULL,
  `acronimo` varchar(5) DEFAULT NULL,
  `pesobandeja` decimal(10,2) DEFAULT '0.00',
  `porcentaje_merma` decimal(2,2) DEFAULT '0.00',
  `is_beneficiado` tinyint(1) DEFAULT '0' COMMENT 'marca de si el producto es beneficiado',
  `is_servicio` tinyint(2) DEFAULT '0',
  `is_producto_terminado` tinyint(2) DEFAULT '1' COMMENT '1: Producto Terminado, 0: Con Insumos',
  `estado` char(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `user_created_at` varchar(45) DEFAULT NULL,
  `user_updated_at` varchar(45) DEFAULT NULL,
  `user_deleted_at` varchar(45) DEFAULT NULL,
  `userid_created_at` int(11) DEFAULT NULL,
  `userid_updated_at` int(11) DEFAULT NULL,
  `userid_deleted_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=956 DEFAULT CHARSET=utf8;

